customrecordcustomfield.description:
This field tracks whether there are audit tags in the data.  Ideally, these conform to the Strongpoint standard:

First operational line: nlapiLogExecution("AUDIT","startime",new Date());

Last Operational Line (and any other return-based end points):
nlapiLogExecution("AUDIT","startime",new Date());

If these are not present, the first and last non-remmed out debug logs are used.  These are less reliable since they may not appear at all or may not be unique.

